import React, { useEffect, useState } from "react";
import materialData from "./data.json";
import './styless.css'
import { Link } from "react-router-dom";

function App() {
  const [searchResults, setSearchResults] = useState([]);
  const [query, setQuery] = useState("");
  const [searchParameters] = useState(["material", "recyclingInfo"]);

  useEffect(() => {
    setSearchResults(materialData);
  }, []);

  function search(data) {
    return data.filter((item) =>
      searchParameters.some((parameter) =>
        item[parameter].toString().toLowerCase().includes(query.toLowerCase())
      )
    );
  }

  return (
    <><div className="navbar bg-base-100">
          <div className="navbar-start">
              <div className="dropdown">
                  <div tabIndex={0} role="button" className="btn btn-ghost lg:hidden">
                      <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h8m-8 6h16" /></svg>
                  </div>
                  <ul tabIndex={0} className="menu menu-sm dropdown-content mt-3 z-[1] p-2 shadow bg-base-100 rounded-box w-52">
                      <li><a>Item 1</a></li>
                      <li>
                          <a>Parent</a>
                          <ul className="p-2">
                              <li><a>Submenu 1</a></li>
                              <li><a>Submenu 2</a></li>
                          </ul>
                      </li>
                      <li><a>Item 3</a></li>
                  </ul>
              </div>
              <a className="btn text-white">EcoVibes</a>
          </div>
          <div className="navbar-center hidden lg:flex">
              <ul className="menu menu-horizontal px-1 text-white">
                  <Link to="/home"><li><a>Home</a></li></Link>
                  <li>
                      <details>
                          <summary>Section</summary>
                          <ul className="p-2">
                              <li><a>ReCycle</a></li>
                              <li><a>Food</a></li>
                              <li><a>Gardening</a></li>
                          </ul>
                      </details>
                  </li>
                  <li><Link to="/section"><a>About Us</a></Link></li>
              </ul>
          </div>
          <div className="navbar-end">
              <Link to="/login"><a className="btn">Login</a></Link>
          </div>
      </div><div className="containers">
              <center>
                  <h1>Search for the item</h1>
              </center>
              <div className="input-box">
                  <input
                      type="search"
                      name="search-form"
                      id="search-form"
                      className="search-input"
                      onChange={(e) => setQuery(e.target.value)}
                      placeholder="Search material or recycling info" />
              </div>
              <center>
                  {search(searchResults).map((item) => {
                      return (
                          <div className="box" key={item.id}>
                              <div className="card">
                                  <div className="category">{item.material}</div>
                                  <div className="heading">
                                      {item.recyclingInfo}
                                  </div>
                              </div>
                          </div>
                      );
                  })}
              </center>
          </div></>
  );
}

export default App;
